	(166, 2, 'แนวทางให้ความสำคัญ IT Enterprise Architecture สำหรับประเทศไทย', '2013-08-22', '2013-08-22', '10:30:00', '12:00:00', 'ห้องประชุม. 401 ชั้น 4) โรงแรมเซ็นทรา ศูนย์ราชการฯ ', 'ตามที่ กระทรวงไอซีที ร่วมกับ สมาคมอุตสาหกรรมเทคโนโลยีสารสนเทศไทย\r\nได้จัดงาน eGovernment forum 2013  ในวันที่ 21-22  สิงหาคม 2556 ที่โรงแรมเซ็นทรา ศูนย์ราชการฯ ถนนแจ้งวัฒนะ\r\nโดยมีสาระ SMART THAILAND, SMART GOVERMENT towards AEC ?CLOUD COMPUTING IN ACTION?\r\nตามไฟล์แนบนั้น\r\nคณะผู้จัดงาน ได้ขอการสนับสนุนให้มีการจัดประชุมผู้บริหาร CIO ทั้งจากภาครัฐและรัฐวิสาหกิจ ให้เป็นหนึ่งในกิจกรรมของงาน eGovernment Forum 2013 ซึ่งกำหนดจัดในวันที่ 22 สิงหาคม 2556  เวลา 10:30น.-12:00 น.  \r\nโดยได้จัดเตรียมห้องประชุมไว้ 1 ห้อง พร้อมอาหารว่าง (ห้องประชุม. 401 ชั้น 4) โรงแรมเซ็นทรา ศูนย์ราชการฯ ถนนแจ้งวัฒนะ\r\nผมจึงถือเป็นโอกาส ที่จะแนะนำ หรือ เปิดตัวสมาคม TITAA  ให้กับ ผู้บริหารไอซีที หน่วยงานรัฐวิสาหกิจ โดย ชมรมไอซีทีรัฐวิสาหกิจแห่งประเทศไทย เป็นแกนหลัก', 0, NULL, NULL, NULL, NULL, '2013-08-20 11:06:05', NULL, '00029025'),
